<#
.SYNOPSIS
  Star-Wars "Imperial March" from embed Base64 String
.DESCRIPTION
  Star-Wars "Imperial March" from embed Base64 String
.NOTES
  Version:        1.0
  Author:         Hacksturcon (G.R.G)
  Creation Date:  19/08/2018
.EXAMPLE
  Just run the script.
#>
$Embed = ''
$Data = [System.Convert]::FromBase64String($Embed)
$File = "$($env:USERPROFILE)\"+[guid]::NewGuid().ToString()+".mid"
Set-Content -Path $File -Value $Data -Encoding Byte
$Player = New-Object System.Windows.Media.MediaPlayer
$Player.Open($File)
$Player.Play()